<div data-component-name="KernelViewer" style="display: flex; flex-direction: column; flex: 1 0 auto;"></div><script>var Kaggle=window.Kaggle||{};Kaggle.State=Kaggle.State||[];Kaggle.State.push({"kernel":{"id":214741,"title":"Titanic Exploring Survival and Random Forest test","forkParent":null,"currentRunId":1019138,"mostRecentRunId":1019138,"url":"/aer503/titanic-exploring-survival-and-random-forest-test","tags":[],"commentCount":0,"upvoteCount":4,"viewCount":1618,"forkCount":5,"bestPublicScore":0.78947,"author":{"id":902168,"displayName":"AlinaR","email":null,"editedEmail":null,"editedEmailCode":null,"userName":"aer503","thumbnailUrl":"https://storage.googleapis.com/kaggle-avatars/thumbnails/default-thumb.png","profileUrl":"/aer503","registerDate":"0001-01-01T00:00:00Z","lastVisitDate":"0001-01-01T00:00:00Z","statusId":0,"performanceTier":1,"userRoles":null,"userLogins":null,"groupIds":null,"duplicateUsers":null,"hasPhoneVerifications":false,"failedNerdchas":0,"hasPendingNerdcha":false,"deleteRequests":null,"userAttributes":null,"isAdmin":false,"isTvc":false,"isKaggleBot":false,"isAdminOrTvc":false,"isAnonymous":false,"canAct":false,"canBeSeen":false,"thumbnailName":null,"activationCode":"00000000-0000-0000-0000-000000000000","isPhoneVerified":false},"isPrivate":false,"updatedTime":"2017-03-19T11:30:45.7266667Z","selfLink":"/kernels/214741","pinnedDockerImageVersionId":null,"isLanguageTemplate":false,"medal":null,"topicId":null,"readGroupId":null,"writeGroupId":null,"slug":"titanic-exploring-survival-and-random-forest-test"},"kernelBlob":{"id":4926063,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n#my submission for Random Forest Titanic\n#I\u0027m new to R. Please do not judge strictly. Any comments, help, tips will be highly appreciated.\n#My hypothesis is that married women who were travled first class had better chance to survive.\n#Let\u0027s see what our prediction results will show us.\nlibrary(dplyr)\nlibrary(randomForest)\nlibrary(rpart)\nlibrary(ggplot2)\n\n\n# The train and test data is stored in the ../input directory\ntrain \u003c- read.csv(\u0022../input/train.csv\u0022)\ntest  \u003c- read.csv(\u0022../input/test.csv\u0022)\n\nset.seed(111)\n#merge into a dataframe\ntrain$Pclass \u003c- as.numeric(as.character(train$Pclass))\ntest$Pclass \u003c-as.numeric(as.character(test$Pclass))\nall_data \u003c- bind_rows(train,test)\nall_data\u003c-as.data.frame(all_data,na.rm=TRUE)\nstr(all_data) #Used for finding the all information\nnames(all_data)#Used for finding the header names\n\n#let us see what we have\nggplot(all_data,  aes(x = factor(\u0022Survived\u0022), fill = Sex) )+ \n  geom_bar()\n\n#check data frame for missinf data\nis.na(all_data)\n#we have missed some data in Fare \nis.na(all_data$Fare[1044])#cheaking for missing data \n#this is TRUE, passenger on row 1044 has NA. We can replace it with the median Fare value.\nall_data$Fare[1044]\u003c- median(all_data$Fare, na.rm=TRUE)\n\n#cheaking for missing data in Embarked\nis.na(all_data$Embarked)\nis.na(all_data$Embarked[c(62,830)])\n# we give them \u0022S\u0022, relying on the majority\nall_data$Pclass\u003c-as.factor(all_data$Pclass)\nall_data$Embarked[c(62,830)]\u003c-\u0022S\u0022\nall_data$Embarked\u003c-factor(all_data$Embarked)#very important step to factorize embarkment codes \n#(if you factorize it. Thus, the code will work, even with missing factors, which were letters \u0022S\u0022, \u0022N\u0022, e.i. characters )\n#We also have some missing data in Age\n# we use prediction method as decision-tree with method \u0022anova\u0022 for continious variable, to fill it\nprediction_age \u003c- rpart(Age~Pclass+Sex+SibSp+Parch+Fare+Embarked, data=all_data[!is.na(all_data$Age),], \n                        method=\u0022anova\u0022)\nall_data$Age[is.na(all_data$Age)]\u003c-predict(prediction_age, all_data[is.na(all_data$Age),])\n#to cheak all colon Age for missing data, after our prediction, we choose range of rows\nis.na(all_data$Age[c(1:750)])\nis.na(all_data$Age[c(751:1309)])\nis.na(all_data[1:300,])\nis.na(all_data[,1:3])\n# let\u0027s create new column Title by grabing title from passenger Names  \nall_data$Title \u003c- gsub(\u0027(.*, )|(\\\\..*)\u0027, \u0027\u0027, all_data$Name)\ntable(all_data$Title)\n#now we have new column \nstr(all_data)\n#we can visualize it as ggplot\nggplot(all_data, aes(Title, fill = Title ) ) +\n  geom_bar()\n#Let\u0027s see what we have regarding our hypothesis \ntable(all_data$Sex, all_data$Title)\ntable(all_data$Sex, all_data$Pclass)\ntable(all_data$Pclass, all_data$Title)\n\n# to clarify the information we have got, let\u0027s reassign some specific titles to their English equvalent\nall_data$Title[all_data$Title == \u0027Mlle\u0027]        \u003c- \u0027Miss\u0027 \nall_data$Title[all_data$Title == \u0027Ms\u0027]          \u003c- \u0027Miss\u0027\nall_data$Title[all_data$Title == \u0027Mme\u0027]         \u003c- \u0027Mrs\u0027 \nall_data$Title[all_data$Title == \u0027Dona\u0027]         \u003c- \u0027Mrs\u0027\nall_data$Title[all_data$Title == \u0027Don\u0027]          \u003c- \u0027Mr\u0027\n# for Passenger, where we are not sure about there marriege status let\u0027s create \u0022question_status\u0022\nquestion_status \u003c- c(\u0027Dr\u0027, \u0027Lady\u0027, \u0027the Countess\u0027,\u0027Capt\u0027, \u0027Col\u0027, \n                \u0027Major\u0027, \u0027Rev\u0027, \u0027Sir\u0027, \u0027Jonkheer\u0027)\nall_data$Title[all_data$Title %in% question_status]  \u003c- \u0027question status\u0027\n#let\u0027s see our plot now\ntable(all_data$Title, all_data$Sex)\nggplot(all_data, aes(Title, fill = Title ) ) +\n  geom_bar()\n#We can clearly see that there were comparatively more married men  than married women. \n#However, let\u0027s see who could survive. Is there a regularity?\n\n#let\u0027s create new virable , such as Married_Woman \nall_data$Married_Woman \u003c- \u0027Not Married\u0027\nall_data$Married_Woman[all_data$Sex == \u0027female\u0027 \u0026 all_data$Title != \u0027Mrs\u0027] \u003c- \u0027Married_Woman\u0027\nstr(all_data)\ntable(all_data$Sex, all_data$Married_Woman)\n\n#don\u0027t forget to factorize new virables and Survived (if didn\u0027t before)  \nall_data$Survived\u003c-as.factor(all_data$Survived)\nall_data$Title\u003c-as.factor(all_data$Title)\nall_data$Married_Woman\u003c-as.factor(all_data$Married_Woman)\nstr(all_data)\n#split data again to train and test\ntrain_again\u003c-all_data[1:891,]\ntest_again\u003c-all_data[892:1309,]\n\n#Random Forest Algorithm\nset.seed(112)\nmy_forest\u003c-randomForest(as.factor(Survived)~Pclass+Sex+Age+SibSp+Parch+Fare+Embarked+Title+Married_Woman,\n                        data=train_again, importance=TRUE, ntree=1000)\n\n#do the prediction\nmy_prediction\u003c- predict(my_forest, newdata = test_again)\n# get importance\nimportance    \u003c- importance(my_forest)\nvarImportance \u003c- data.frame(Variables = row.names(importance), \n                            Importance = round(importance[ ,\u0027MeanDecreaseGini\u0027],2))\n#check the importance\nvarImpPlot(my_forest)\n# create a rank variable based on importance\nrankImportance \u003c- varImportance %\u003e%\n  mutate(Rank = paste0(\u0027#\u0027,dense_rank(desc(Importance))))\n\n# Use ggplot2 to visualize the relative importance of variables\nggplot(rankImportance, aes(x = reorder(Variables, Importance), \n                           y = Importance, fill = Importance)) +\n  geom_bar(stat=\u0027identity\u0027) + \n  geom_text(aes(x = Variables, y = 0.5, label = Rank),\n            hjust=0, vjust=0.55, size = 4, colour = \u0027red\u0027) +\n  labs(x = \u0027Variables\u0027) +\n  coord_flip() + \n  theme_classic()\n#create a data frame with two columns PassengerID\u0026Survived\nmy_solution\u003c-data.frame(PassengerId=test_again$PassengerId, Survived = my_prediction)\nwrite.csv(my_solution, file=\u0022my_RF_solution.csv\u0022, row.names = FALSE)\n\n\n\n","dateCreated":"2017-03-19T11:30:44.69Z"},"kernelRun":{"id":1019138,"kernelId":214741,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"Titanic Exploring Survival and Random Forest test","dateCreated":"2017-03-19T11:30:44.69Z","dateEvaluated":"2017-03-19T11:30:45.727Z","workerContainerPort":null,"workerUptimeSeconds":530147,"workerIPAddress":"10.3.0.4       ","scriptLanguageId":1,"scriptLanguageName":"R","renderedOutputUrl":null,"commit":{"id":4926063,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":3136,"databundleVersionId":null}],"sourceType":"script","language":"r","isGpuEnabled":false,"isInternetEnabled":false},"source":"\n#my submission for Random Forest Titanic\n#I\u0027m new to R. Please do not judge strictly. Any comments, help, tips will be highly appreciated.\n#My hypothesis is that married women who were travled first class had better chance to survive.\n#Let\u0027s see what our prediction results will show us.\nlibrary(dplyr)\nlibrary(randomForest)\nlibrary(rpart)\nlibrary(ggplot2)\n\n\n# The train and test data is stored in the ../input directory\ntrain \u003c- read.csv(\u0022../input/train.csv\u0022)\ntest  \u003c- read.csv(\u0022../input/test.csv\u0022)\n\nset.seed(111)\n#merge into a dataframe\ntrain$Pclass \u003c- as.numeric(as.character(train$Pclass))\ntest$Pclass \u003c-as.numeric(as.character(test$Pclass))\nall_data \u003c- bind_rows(train,test)\nall_data\u003c-as.data.frame(all_data,na.rm=TRUE)\nstr(all_data) #Used for finding the all information\nnames(all_data)#Used for finding the header names\n\n#let us see what we have\nggplot(all_data,  aes(x = factor(\u0022Survived\u0022), fill = Sex) )+ \n  geom_bar()\n\n#check data frame for missinf data\nis.na(all_data)\n#we have missed some data in Fare \nis.na(all_data$Fare[1044])#cheaking for missing data \n#this is TRUE, passenger on row 1044 has NA. We can replace it with the median Fare value.\nall_data$Fare[1044]\u003c- median(all_data$Fare, na.rm=TRUE)\n\n#cheaking for missing data in Embarked\nis.na(all_data$Embarked)\nis.na(all_data$Embarked[c(62,830)])\n# we give them \u0022S\u0022, relying on the majority\nall_data$Pclass\u003c-as.factor(all_data$Pclass)\nall_data$Embarked[c(62,830)]\u003c-\u0022S\u0022\nall_data$Embarked\u003c-factor(all_data$Embarked)#very important step to factorize embarkment codes \n#(if you factorize it. Thus, the code will work, even with missing factors, which were letters \u0022S\u0022, \u0022N\u0022, e.i. characters )\n#We also have some missing data in Age\n# we use prediction method as decision-tree with method \u0022anova\u0022 for continious variable, to fill it\nprediction_age \u003c- rpart(Age~Pclass+Sex+SibSp+Parch+Fare+Embarked, data=all_data[!is.na(all_data$Age),], \n                        method=\u0022anova\u0022)\nall_data$Age[is.na(all_data$Age)]\u003c-predict(prediction_age, all_data[is.na(all_data$Age),])\n#to cheak all colon Age for missing data, after our prediction, we choose range of rows\nis.na(all_data$Age[c(1:750)])\nis.na(all_data$Age[c(751:1309)])\nis.na(all_data[1:300,])\nis.na(all_data[,1:3])\n# let\u0027s create new column Title by grabing title from passenger Names  \nall_data$Title \u003c- gsub(\u0027(.*, )|(\\\\..*)\u0027, \u0027\u0027, all_data$Name)\ntable(all_data$Title)\n#now we have new column \nstr(all_data)\n#we can visualize it as ggplot\nggplot(all_data, aes(Title, fill = Title ) ) +\n  geom_bar()\n#Let\u0027s see what we have regarding our hypothesis \ntable(all_data$Sex, all_data$Title)\ntable(all_data$Sex, all_data$Pclass)\ntable(all_data$Pclass, all_data$Title)\n\n# to clarify the information we have got, let\u0027s reassign some specific titles to their English equvalent\nall_data$Title[all_data$Title == \u0027Mlle\u0027]        \u003c- \u0027Miss\u0027 \nall_data$Title[all_data$Title == \u0027Ms\u0027]          \u003c- \u0027Miss\u0027\nall_data$Title[all_data$Title == \u0027Mme\u0027]         \u003c- \u0027Mrs\u0027 \nall_data$Title[all_data$Title == \u0027Dona\u0027]         \u003c- \u0027Mrs\u0027\nall_data$Title[all_data$Title == \u0027Don\u0027]          \u003c- \u0027Mr\u0027\n# for Passenger, where we are not sure about there marriege status let\u0027s create \u0022question_status\u0022\nquestion_status \u003c- c(\u0027Dr\u0027, \u0027Lady\u0027, \u0027the Countess\u0027,\u0027Capt\u0027, \u0027Col\u0027, \n                \u0027Major\u0027, \u0027Rev\u0027, \u0027Sir\u0027, \u0027Jonkheer\u0027)\nall_data$Title[all_data$Title %in% question_status]  \u003c- \u0027question status\u0027\n#let\u0027s see our plot now\ntable(all_data$Title, all_data$Sex)\nggplot(all_data, aes(Title, fill = Title ) ) +\n  geom_bar()\n#We can clearly see that there were comparatively more married men  than married women. \n#However, let\u0027s see who could survive. Is there a regularity?\n\n#let\u0027s create new virable , such as Married_Woman \nall_data$Married_Woman \u003c- \u0027Not Married\u0027\nall_data$Married_Woman[all_data$Sex == \u0027female\u0027 \u0026 all_data$Title != \u0027Mrs\u0027] \u003c- \u0027Married_Woman\u0027\nstr(all_data)\ntable(all_data$Sex, all_data$Married_Woman)\n\n#don\u0027t forget to factorize new virables and Survived (if didn\u0027t before)  \nall_data$Survived\u003c-as.factor(all_data$Survived)\nall_data$Title\u003c-as.factor(all_data$Title)\nall_data$Married_Woman\u003c-as.factor(all_data$Married_Woman)\nstr(all_data)\n#split data again to train and test\ntrain_again\u003c-all_data[1:891,]\ntest_again\u003c-all_data[892:1309,]\n\n#Random Forest Algorithm\nset.seed(112)\nmy_forest\u003c-randomForest(as.factor(Survived)~Pclass+Sex+Age+SibSp+Parch+Fare+Embarked+Title+Married_Woman,\n                        data=train_again, importance=TRUE, ntree=1000)\n\n#do the prediction\nmy_prediction\u003c- predict(my_forest, newdata = test_again)\n# get importance\nimportance    \u003c- importance(my_forest)\nvarImportance \u003c- data.frame(Variables = row.names(importance), \n                            Importance = round(importance[ ,\u0027MeanDecreaseGini\u0027],2))\n#check the importance\nvarImpPlot(my_forest)\n# create a rank variable based on importance\nrankImportance \u003c- varImportance %\u003e%\n  mutate(Rank = paste0(\u0027#\u0027,dense_rank(desc(Importance))))\n\n# Use ggplot2 to visualize the relative importance of variables\nggplot(rankImportance, aes(x = reorder(Variables, Importance), \n                           y = Importance, fill = Importance)) +\n  geom_bar(stat=\u0027identity\u0027) + \n  geom_text(aes(x = Variables, y = 0.5, label = Rank),\n            hjust=0, vjust=0.55, size = 4, colour = \u0027red\u0027) +\n  labs(x = \u0027Variables\u0027) +\n  coord_flip() + \n  theme_classic()\n#create a data frame with two columns PassengerID\u0026Survived\nmy_solution\u003c-data.frame(PassengerId=test_again$PassengerId, Survived = my_prediction)\nwrite.csv(my_solution, file=\u0022my_RF_solution.csv\u0022, row.names = FALSE)\n\n\n\n","dateCreated":"2017-03-19T11:30:44.69Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e472428\u003c/disk_kb_free\u003e\u003cdocker_image_id\u003esha256:a236e47ea687b7714dba889be0a21997c74dbf72cebaf1deca68fc5e0b45a975\u003c/docker_image_id\u003e\u003cdocker_image_name\u003ekaggle/rstats\u003c/docker_image_name\u003e\u003cexit_code\u003e0\u003c/exit_code\u003e\u003cfailure_message /\u003e\u003cout_of_memory\u003eFalse\u003c/out_of_memory\u003e\u003crun_time_seconds\u003e4.61531163402833\u003c/run_time_seconds\u003e\u003csucceeded\u003eTrue\u003c/succeeded\u003e\u003ctimeout_exceeded\u003eFalse\u003c/timeout_exceeded\u003e\u003cused_all_space\u003eFalse\u003c/used_all_space\u003e\u003cwas_killed\u003eFalse\u003c/was_killed\u003e\u003c/results\u003e","runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","d l":false,"info":null,"name":"Embarked","description":"The port in which a passenger has embarked. C - Cherbourg, S - Southampton, Q = Queenstown"}],"totalRows":null,"type":"genericTable","collapsed":true,"info":{"metrics":null,"archiveInfo":null,"archiveInfoV2":null,"blobFileInfo":null,"convertCsvInfo":null,"kernelReference":null},"settings":{"csvSettings":null,"bigQuerySettings":null,"bigQueryMirrorSettings":null,"storageSettings":null,"remoteUrlSettings":null,"remoteGithubSettings":null},"render":null,"children":[],"name":"","description":null}],"name":"train.csv","description":"contains data \n"}],"name":"Titanic: Machine Learning from Disaster","description":"\u003ch3\u003eOverview\u003c/h3\u003e\n\u003cp\u003eThe data has been split into two groups:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003etraining set (train.csv)\u003c/li\u003e\n\u003cli\u003etest set (test.csv)\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the ground truth) for each passenger. Your model will be based on features like passengers gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancs were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parch=0 for them.\u003c/p\u003e"}],"versions":[{"id":1019138,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"R","lastRunTime":"2017-03-19T11:30:44.69Z","linesChangedFromPrevious":0,"linesDeletedFromPrevious":24,"linesInsertedFromPrevious":6,"outputFilesTotalSizeBytes":0,"runInfo":{"dockerfileUrl":"https://github.com/Kaggle/docker-rstats/blob/master/Dockerfile","dockerHubUrl":"https://registry.hub.docker.com/u/kaggle/rstats/","dockerImageId":"sha256:a236e47ea687b7714dba889be0a21997c74dbf72cebaf1deca68fc5e0b45a975","dockerImageName":"kaggle/rstats","exitCode":0,"failureMessage":"","isValidStatus":true,"runTimeSeconds":4.61531163402833,"succeeded":true,"timeoutExceeded":false,"usedAllSpace":false},"status":"complete","title":"Titanic Exploring Survival and Random Forest test","url":"/aer503/titanic-exploring-survival-and-random-forest-test?scriptVersionId=1019138","versionNumber":6,"hasVersionNumber":true,"isRedacted":false,"versionAuthor":null},{"id":1019133,"kernelVersionId":null,"isForkParent":false,"isNotebook":false,"languageName":"
